Here is a GNU Octave script that solves the equation \(\sin(3\theta) = \cos(7\theta)\) and prints the smallest positive angle \(\theta\) in degrees:

```octave
# Define the function to find the solution
function theta = find_solution()
    theta = 0;  # Start from 0 degrees
    step = 0.01;  # Increment by 0.01 degrees
    while theta < 90
        if sin(3*theta) == cos(7*theta)
            break;
        end
        theta = theta + step;
    end
endfunction

# Execute the function and print the solution
theta_solution = find_solution();
printf("The smallest positive angle is theta = %.2f degrees\n", theta_solution);
```

