% Initialize the count of negative products
negative_products = 0;

% Iterate over all possible combinations of the two spinners
for i = 1:3
    for j = 1:3
        % Calculate the product
        product = spinners(i, 1) * spinners(j, 2);

        % Check if the product is negative
        if (product < 0)
            % Increment the count of negative products
            negative_products = negative_products + 1;
        end
    end
end

% Calculate the probability
