function factors = prime_factors(n)
  factors = [];
  % Divide n by 2 to get rid of all even factors
  while n % 2 == 0
    factors = [factors, 2];
    n = n / 2;
  end
  % n must be odd at this point, so we can skip one element (Note i = i +2)
  for i = 3:2:sqrt(n)
    % While i divides n, append i and divide n
    while n % i == 0
      factors = [factors, i];
      n = n / i;
    end
  end
  % This condition is to handle the case when n is a prime number greater than 2
  if n > 2
    factors = [factors, n];
  end
  % Remove duplicate factors and sort them
  factors = unique(factors, ' stable');
  % Return the greatest prime factor
  greatest_prime_factor = factors(end);
  disp(greatest_prime_factor);
endfunction

